sys_variable_value.value:
(function execute(inputs, outputs) {
     try {
var alertRule = new GlideRecord('x_885373_event_tes_custom_subflow_rules');
alertRule.addQuery('alert_management_rule', inputs.alertRuleId);
alertRule.query();

if(alertRule.next()){
if(alertRule.u_choice_1 == 1){
outputs['priority'] = 1;
outputs['urgency'] = 1;
outputs['impact'] = 1;
}
else if(alertRule.u_choice_1 == 2){
outputs['priority'] = 2;
outputs['urgency'] = 2;
outputs['impact'] = 2; 
}
else if(alertRule.u_choice_1 == 3){
    outputs['priority'] = 3;
outputs['urgency'] = 3;
outputs['impact'] = 3;
}
else if(alertRule.u_choice_1 == 'subflow'){
        var flowInputs = {};
    flowInputs['alertgr'] = inputs.alertGR;
    flowInputs['executionid'] = inputs.executionID;
    flowInputs['alertruleid'] = inputs.alertRuleId; 
    var gr = new GlideRecord('x_885373_event_tes_custom_subflow_rules');
    gr.addQuery('alert_management_rule.sys_id',inputs.alertRuleId);
    gr.query();
    var subflowName = 'x_885373_event_tes.'
    if(gr.next()){
       subflowName += gr.u_priority_subflow.internal_name;
      var output = sn_fd.FlowAPI.executeSubflow(subflowName, flowInputs);
      // Get Outputs:
      // Note: outputs can only be retrieved when executing synchronously.
    outputs['priority'] = output['priority'];
    outputs['impact'] = output['impact'];
    outputs['urgency'] = output['urgency'];
}
}else{
outputs['priority'] = 3;
outputs['urgency'] = 3;
outputs['impact'] = 3;
}
}else{
  outputs['priority'] = 3;
  outputs['urgency'] = 3;
  outputs['impact'] = 3;
}
     }
 catch (ex) {
    var message = ex.getMessage();
    gs.error(message);
  }
})(inputs, outputs);

